  false,\n\t\"url\": null,\n\t\"notes\": \"This is a summary of hunting activities,
  game mammal surveys, and law enforcement on Neal Smith National Wildlife Refuge
  between 1992 and 2009.  For each year, a list of game animals found on the Refuge
  is provided along with information about population trends for the various animals.
  \ Bag limits and other regulations are also included.  The number of hunters and
  the quality of the hunting is described for each season.  Information about law
  enforcement issues that arose is also included.\",\n\t\"license_title\": \"License
